INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ヒヨリ", "A", 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ", 2, "東山奈央", "人助けが大好き！　前向き格闘娘", "獣人族", 100101, 8, "人助け、応援", 155, 16, 27, 44);
