INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ミソギ", "O", 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "リトルリリカル", 5, "諸星すみれ", "探検好きのイタズラっ子", "ヒューマン", 100401, 8, "いたずら、探検", 128, 9, 10, 27);
