INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ミヤコ", "B", 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）", 7, "雨宮天", "プリン大好きゴースト娘", "魔族", 100701, 1, "プリンを食べること", 130, 14, 23, 32);
INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ユキ", "AB", 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ヴァイスフリューゲル　ランドソル支部", 15, "大空直美", "ボクは誰よりも美しい", "エルフ", 100801, 10, "鏡で自分を見ること", 150, 14, 10, 40);
