INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("マホ", "O", 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "自警団（カォン）", 10, "内田真礼", "マホマホ王国のプリンセス", "獣人族", 101001, 9, "空想、ぬいぐるみ集め", 155, 16, 22, 42);
