INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ミミ", "O", 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "リトルリリカル", 5, "日高里菜", "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", 102001, 4, "かわいいもの集め", 117, 10, 3, 21);
INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("クルミ", "B", 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", 9, "植田佳奈", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 102101, 6, "観劇、おままごと", 150, 12, 9, 40);
INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("ヨリ", "O", 0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "悪魔偽王国軍（ディアボロス）", 7, "原紗友里", "人見知りであまのじゃくな女の子", "魔族", 102201, 11, "ゲーム全般", 150, 13, 22, 40);
