INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("サレン", "A", 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレンディア救護院", 9, "堀江由衣", "救護院を経営する優しい庶民派お嬢様", "エルフ", 102801, 10, "経営、お茶会", 156, 17, 4, 43);
