INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("チカ（クリスマス）", "O", 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", 4, "福原綾香", "人々を守るために歌う、唱喚士の少女", "ヒューマン", 108401, 6, "各種楽器", 163, 17, 3, 46);
INSERT INTO `v1_361cdc929565019a5995e6513db0d6f562456f6fbcd5a709dfbbdc9c837f4a90` VALUES ("クルミ（クリスマス）", "B", 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", 9, "植田佳奈", "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 108501, 6, "観劇、おままごと", 150, 12, 9, 40);
